export const HomePage = () => {
  return (
    <div>
      <h1 className="title">Welcome to Projects Management</h1>
      <div class="buttons">
        <button class="button is-primary">View Projects</button>
        <button class="button is-info">Create Projects</button>
        <button class="button is-warning">Update Projects</button>
        <button class="button is-danger">Delete Projects</button>
      </div>
    </div>
  );
};
